SELECT c.CompanyDescription, CASE 
		WHEN f.ITemNumber < 100000
			THEN f.ItemNumber + 600000
		ELSE f.ItemNumber + 6000000
		END AS itemnumber
	,Sum(f.unitsdemanded) AS UnitsDemanded
	,Sum(f.dollarsdemanded) AS DollarsDemanded
	,Case when Sum(unitsdemanded) = 0 then 0 else Round((Sum(unitsdemanded-(unitsnotship + unitslost))/Sum(cast(UnitsDemanded as float)))*100,2) End as INITFill
	,Case when Sum(unitsdemanded) = 0 then 0 else Round((Sum(unitsshipped+unitsbackordercurrent)/Sum(Cast(unitsdemanded as float)))*100,2) End as FInalFIll
	,Sum(isnull(DollarsLost,0) + dollarsshipdelete) as LostSalesDollars
	,Sum(unitsLost + unitsshipdelete ) as LostSalesUnits
	,case when Sum(DollarsDemanded) = 0 then 0 else  Round((Sum(isnull(DollarsLost,0) + dollarsshipdelete)/Sum(cast(f.dollarsdemanded as float)))*100,2) End as LostSalesPctDollars
	,case when Sum(unitsdemanded) = 0 then 0 else Round((Sum(unitsLost + unitsshipdelete )/Sum(cast(f.unitsdemanded as float)))*100,2) End as LostSalesPctUnits
	FROM Merch2.dbo.FillRate f Join MDW1.dbo.Company c on f.CompanyCode = c.Company
WHERE f.CalendarSeq = '810'
	AND f.companycode in('7','C','G','J','M','W','Q')
	AND f.Season IN ('F14')
	AND (
		CASE 
			WHEN f.ITemNumber < 100000
